description:
When Amy feels her husband has lost interest in her, she turns to her hot co-worker for some sexual validation. Feeling confident from the affair, she demands a divorce but soon finds that the grass isn't always greener on the other side. Has she made a huge mistake? Is she crazy or just Crazy in Love?

